import { Container, Typography } from '@mui/material'
import React from 'react'

const Home = () => {
    return (
        <Container maxWidth='lg'>
            <Typography>
                Reimagine Your Spaces with AI-Powered Design
            </Typography>
        </Container>
    )
}

export default Home
